import React from 'react';

const Item = ({ title, key, onMoveLeft, onMoveRight }) => {
  
  const leftStyle = key == "leftData" ? "display:none" : "";
  const rightStyle = key == "rightData" ? "display:none" : "";

   return (
    <div className="row">
      <span>
        <span>{title}</span>

        <button style={leftStyle} type="button" onClick={onMoveLeft}>
          <i className="fa fa-angle-left"></i>
        </button>

        <button style={leftStyle} type="button" onClick={onMoveRight}>
          <i className="fa fa-angle-right"></i>
        </button>
      </span>
    </div>
  );
};

export default Item;
